    status: [
      {
        value: Math.floor(Math.random() * 10),
        label: valueEnum[Math.floor(Math.random() * 10) % 4],
      },
      {
        value: Math.floor(Math.random() * 10),
        label: valueEnum[Math.floor(Math.random() * 10) % 4],
      },
    ],
